import React from "react";

function AuthForm() {
    return (
        <div>
            <ul>
                <li><input type="text" placeholder="아이디 입력"/> </li>
                <li><input type="password" placeholder="패스워드 입력"/> </li>

            </ul>
        </div>
    )
}

export default AuthForm;
